import React from 'react';
import './App.css';
import {Todolist} from "./Todolist";


function App() {
    const todoLisTitle_1 = "What to learn"
    const todoLisTitle_2 = "Songs"
    const todoLisTitle_3 = "Books"

    return (
        <div className="App">
            <Todolist title={todoLisTitle_1}/>
            <Todolist title={todoLisTitle_2}/>
            <Todolist title={todoLisTitle_3}/>
        </div>
    );
}

export default App;
